import "./Ownable.sol";
import "./FarmerRole.sol";
import "./DistributorRole.sol";
import "./RetailerRole.sol";
import "./Roles.sol";
import "./Context.sol";

pragma solidity >= 0.5.0 < 0.9.0;

contract main is
    Ownable,
    FarmerRole,
    DistributorRole,
    RetailerRole
{
//   struct Farmer{
//         uint f_id;
//         string f_name;
//         string f_email;
//         uint f_phone;
//         string f_password;
//         string f_location;
//     }

//     struct Distributor{
//         uint d_id;
//         string d_name;
//         string d_email;
//         uint d_phone;
//         string d_password;
//         string d_location;
//     }

//     struct Retailer{
//         uint r_id;
//         string r_name;
//         string r_email;
//         uint r_phone;
//         string r_password;
//         string r_location;
//     }

//     struct Product{
//         uint batch_id;
//         uint productId;
//         string productName;
//         string desc;
//         string productType;
//         string farmer;
//         string distributor;
//         string retailer;
//         string date_of_harvest;
//         address payable distribute;
//         address payable retail;
//     }
    // uint counter = 1;
    // Product[] public products;

    //@Modified Code starts from heree ------->

    address owner;
    // Define a variable called 'productCode' for Universal Product Code (productCode)
    uint256 productCode;
    // Define a variable called 'stockUnit' for Stock Keeping Unit (stockUnit)
    uint256 stockUnit;
    // Define a public mapping 'items' that maps the productCode to an Item.
    mapping(uint256 => Item) items;
    // Define a public mapping 'itemsHistory' that maps the productCode to an array of TxHash,
    // that track its journey through the supply chain -- to be sent from DApp.
    mapping(uint256 => Txblocks) itemsHistory;

    enum Modified {
        CropRegistered,
        ForSaleByFarmer,
        PurchasedByDistributor,
        ShippedByFarmer, // 3
        ReceivedByDistributor, // 4
        ProcessedByDistributor, // 6
        ForSaleByDistributor, // 7
        PurchasedByRetailer, // 8
        ShippedByDistributor, // 9
        ReceivedByRetailer, // 10
        ForSaleByRetailer
